// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract TourathAuth {
    mapping(address => bool) public registeredUsers;
    mapping(address => uint256) public tokenBalance;
    address public owner;

    event UserRegistered(address indexed user);
    event TokensAwarded(address indexed user, uint256 amount);

    constructor() {
        owner = msg.sender;
    }

    function register() public {
        require(!registeredUsers[msg.sender], "User already registered");
        registeredUsers[msg.sender] = true;
        emit UserRegistered(msg.sender);
    }

    function awardTokens(address user, uint256 amount) public {
        require(msg.sender == owner, "Only admin can award tokens");
        require(registeredUsers[user], "User not registered");
        tokenBalance[user] += amount;
        emit TokensAwarded(user, amount);
    }

    function isRegistered(address user) public view returns (bool) {
        return registeredUsers[user];
    }

    function getTokenBalance(address user) public view returns (uint256) {
        return tokenBalance[user];
    }
}

